import "./header.css";
import Logo from "../../img/logo.png";
import NavBar from "../../components/navBar/navBar";

export default function header(){
    return(
       <div>
      <NavBar Logo={Logo}/>
      <div className="header">
              <div className="headerSide">
                  <h1>New Paradigm</h1>
                  <p>Where Love and Acceptance is Retained</p>
              </div>
             </div>
       </div> 
        
    );
}
